INSERT INTO `produto` (`produto_id`, `nome`, `preco`, `classe`, `descricao`, `imagem`) VALUES
(1, 'Backbox', 0.00, 'Sistema Operacional', 'BackBox Linux é uma distribuição Linux orientada para testes de penetração e avaliação de segurança, fornecendo um kit de ferramentas de análise de rede e sistemas. Inclui algumas das ferramentas de segurança e análise mais comumente conhecidas, visando uma ampla variedade de objetivos, que vão desde análise de aplicativos da web até análise de rede, testes de estresse (stress tests), sniffing, avaliação de vulnerabilidade, análise forense de computadores, automotivo e exploração.', );
INSERT INTO `produto` (`produto_id`, `nome`, `preco`, `classe`, `descricao`, `imagem`) VALUES
(2, 'Samurai Web Testing Framework', 0.00, 'Sistema Operacional', 'É uma distribuição orientada à segurança que se concentra em testes de penetração para aplicativos Web. Ele inclui uma variedade de ferramentas gráficas, de linha de comando e baseadas em navegador para testar vulnerabilidades comuns da Web.', );
