INSERT INTO `produto` (`produto_id`, `nome`, `preco`, `classe`, `descricao`, `imagem`) VALUES
(5, 'Parrot OS', 0.00, 'Sistema Operacional', 'Um sistema operacional Linux, baseado no Debian, que procura atender um público bem específico, especialistas em segurança, pessoas que trabalham com computação forense, estudantes de ciência da computação e engenharia, pesquisadores, desenvolvedores de software e, claro, os hackers.', );
INSERT INTO `produto` (`produto_id`, `nome`, `preco`, `classe`, `descricao`, `imagem`) VALUES
(6, 'Burp suit ', 455.72, 'ferramenta', 'Burp Suite desempenha um papel crítico na segurança de aplicações web, agindo como um proxy web que permite a interceptação e modificação do tráfego HTTP/HTTPS, permitindo a detecção de vulnerabilidades e a compreensão do tráfego de rede', );
INSERT INTO `produto` (`produto_id`, `nome`, `preco`, `classe`, `descricao`, `imagem`) VALUES
(7, 'nmap', 0.00, 'ferramenta', 'muito utilizado para avaliar a segurança dos computadores, e para descobrir serviços ou servidores em uma rede de computadores. Nmap é conhecido pela sua rapidez e pelas opções que dispõe.', );
INSERT INTO `produto` (`produto_id`, `nome`, `preco`, `classe`, `descricao`, `imagem`) VALUES
(8, 'Maltego', 112.48, 'ferramenta', 'Maltego oferece mineração de dados em tempo real e coleta de informações, bem como a representação dessas informações em um gráfico baseado em nós, tornando padrões e conexões de múltiplas ordens entre essas informações facilmente identificáveis.', );
INSERT INTO `produto` (`produto_id`, `nome`, `preco`, `classe`, `descricao`, `imagem`) VALUES
(9, 'Metasploit', 0.00, 'ferramenta', 'Um projeto de segurança de computadores que fornece informações sobre vulnerabilidades de segurança e ajuda em testes de penetração e desenvolvimento de assinaturas IDS. Propriedade da Rapid7, empresa de segurança sediada em Boston, Massachusetts e disponibilizada através de nosso site. ', );
